import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {Link} from "react-router-dom";

function Login() {
  return (
    <div>
    <h1 className="customer-heading">Uber <span className="heading-eats">Eats</span></h1>
    <h1 className="form-floating">Welcome Back</h1>
    <div class="form-floating mb-3">
     <input type="email" class="form-control" id="floatingInput" placeholder="name@example.com" name="email" onChange={(e) => {
       setEmail(e.target.value);
     }} />
     <label for="floatingInput">Sign in with your email address</label>
    </div>
    <div class="form-floating">
     <input type="password" class="form-control" id="floatingPassword" placeholder="Password" name="password" onChange={(e) =>{
       setPassword(e.target.value);
     }} />
     <label for="floatingPassword">Password</label>
     </div>
     <div class="d-grid gap-2 form-floating">
     <button onClick={getLoggedIn} type="button" class="btn btn-outline-primary">Continue</button>
     </div>
    </div>
  );
}

export default Login;
